    methods (Access = private)

        function EpsiTimerFcn(app, ~, event)


            obj = load('/Users/ncouto/Library/CloudStorage/GoogleDrive-ncouto@ucsd.edu/Shared drives/MOD data 2022 BLT3/05_processed_data/0812_sta08_d17_ef1_pc2/mat/EPSI22_08_13_041146.mat');
            obj.plot_properties = set_epsi_plot_properties;
            cols = obj.plot_properties.Colors;

            nSec = 1*60;
            nDay = nSec/(3600*24);

            % Define time axes for the plot
            time_array = make_time_arrays(obj);

            %% UIAxes - t1 and t2
            app.UIAxes_1.NextPlot = 'replace';
            if app.SubtractmeanCheckBox.Value
                % t1 and t2 - differences from mean
                plot(app.UIAxes_1,time_array.epsi,obj.epsi.t1_volt-nanmean(obj.epsi.t1_volt),'.','Color',cols.t1,'LineWidth',obj.plot_properties.LineWidth,'displayname',sprintf('t1 - %1.1f',nanmean(obj.epsi.t1_volt)));
                hold(app.UIAxes_1,'on')
                plot(app.UIAxes_1,time_array.epsi,obj.epsi.t2_volt-nanmean(obj.epsi.t2_volt),'.','Color',cols.t2,'LineWidth',obj.plot_properties.LineWidth,'displayname',sprintf('t2 - %1.1f',nanmean(obj.epsi.t2_volt)));

            elseif ~app.SubtractmeanCheckBox.Value
                % t1 and t2
                plot(app.UIAxes_1,time_array.epsi,obj.epsi.t1_volt,'.','Color',cols.t1,'LineWidth',obj.plot_properties.LineWidth,'displayname','t1');
                hold(app.UIAxes_1,'on')
                plot(app.UIAxes_1,time_array.epsi,obj.epsi.t2_volt,'.','Color',cols.t2,'LineWidth',obj.plot_properties.LineWidth,'displayname','t2');
            end

            %% UIAxes_2 s1 and s2
            app.UIAxes_2.NextPlot = 'replace';
            plot(app.UIAxes_2,time_array.epsi,obj.epsi.s1_volt,'.','Color',cols.s1,'LineWidth',obj.plot_properties.LineWidth,'displayname','s1')
            hold(app.UIAxes_2,'on')
            plot(app.UIAxes_2,time_array.epsi,obj.epsi.s2_volt,'.','Color',cols.s2,'LineWidth',obj.plot_properties.LineWidth,'displayname','s2')

            % a1
            app.UIAxes_3.NextPlot = 'replace';
            plot(app.UIAxes_3,time_array.epsi,obj.epsi.a1_g,'.','Color',cols.a1,'LineWidth',obj.plot_properties.LineWidth,'displayname','a1')

            % a2 and a3
            app.UIAxes_4.NextPlot = 'replace';
            plot(app.UIAxes_4,time_array.epsi,obj.epsi.a2_g,'.','Color',cols.a2,'LineWidth',obj.plot_properties.LineWidth,'displayname','a2')
            hold(app.UIAxes_4,'on')
            plot(app.UIAxes_4,time_array.epsi,obj.epsi.a3_g,'.','Color',cols.a3,'LineWidth',obj.plot_properties.LineWidth,'displayname','a3')

            % Add legends
            legend(app.UIAxes_1,'location','northwest')
            legend(app.UIAxes_2,'location','northwest')
            legend(app.UIAxes_3,'location','northwest')
            legend(app.UIAxes_4,'location','northwest')

            %% Adjust axes properties
            app.UIAxes_1.FontName = 'Helvetica';
            app.UIAxes_1.FontSize = 12;
            app.UIAxes_1.LineWidth = 0.5;
            app.UIAxes_1.XTickLabel = '';

            app.UIAxes_2.FontName = 'Helvetica';
            app.UIAxes_2.FontSize = 12;
            app.UIAxes_2.LineWidth = 0.5;
            app.UIAxes_2.XTickLabel = '';

            app.UIAxes_3.FontName = 'Helvetica';
            app.UIAxes_3.FontSize = 12;
            app.UIAxes_3.LineWidth = 0.5;
            app.UIAxes_3.XTickLabel = '';

            app.UIAxes_4.FontName = 'Helvetica';
            app.UIAxes_4.FontSize = 12;
            app.UIAxes_4.LineWidth = 0.5;
            app.UIAxes_4.XTickLabel = '';

            function [time_array] = make_time_arrays(obj)

                field_names = {'epsi','ctd','alt','vnav','gps'};

                for iField = 1:length(field_names)

                    classCondition = isclassfield(obj,field_names{iField}) && ~isempty(obj.(field_names{iField}));
                    if classCondition
                        structCondition = ~isempty(obj.(field_names{iField}));
                        if structCondition
                            % Do you have dnum or seconds?
                            if isfield(obj.(field_names{iField}),'dnum')
                                time_array.(field_names{iField}) = obj.(field_names{iField}).dnum;
                            else
                                time_array.(field_names{iField}) = obj.(field_names{iField}).time_s;
                            end
                        end
                    end %end if classCondition
                end %end loop through fields
            end %end make_time_arrays
        end
    end



    % Callbacks that handle component events
    methods (Access = private)

        % Code that executes after component creation
        function startupFcn(app)
            % Add paths to epsi library
            goto('epsilometer')

            % Create timer object
            app.EpsiTimer = timer(...
            'ExecutionMode', 'fixedRate', ...      % Run timer repeatedly
            'Period', 5, ...                       % Period is 5 seconds
            'BusyMode', 'queue',...                % Queue timer callbacks when busy
            'TimerFcn', @app.EpsiTimerFcn);   % Callback that runs every period
        end

        % Button pushed function: StreamdataButton
        function StreamdataButtonPushed(app, event)

            % If timer is not running, start it
            if strcmp(app.EpsiTimer.Running, 'off')
                % Start timer
                start(app.EpsiTimer);
            end
        end

        % Menu selected function: SelectDataDirectoryMenu
        function SelectDataDirectoryMenuSelected(app, event)
            data_dir = uigetdir();
        end

        % Close request function: UIFigure
        function UIFigureCloseRequest(app, event)
             % Stop timer, then delete timer and figure
            stop(app.EpsiTimer);
            delete(app.EpsiTimer);
            delete(app);
        end

        % Value changed function: SubtractmeanCheckBox
        function SubtractmeanCheckBoxValueChanged(app, event)
            value = app.SubtractmeanCheckBox.Value;
            
        end

        % Size changed function: UIFigure
        function UIFigureSizeChanged(app, event)
            position = app.UIFigure.Position;          
        end
    end

